sTitle2:"",featuresSubtitle:"Help parents track all their children's computer activities safely and visually:",feature1:"Record website access history and software usage",feature2:"Take periodic screenshots for easy parental control",feature3:"Detailed statistics of time spent on each website and application",feature4:"Synchronize all data and reports to parents' mobile application",protectionTitle:"PROTECT CHILDREN SAFELY ON THE INTERNET",protectionFeature1:"KidoLock helps parents proactively protect their children from harmful content and online risks",protectionFeature2:"Detect and block websites with bad content using smart AI",protectionFeature3:"Block adult sites, violence, gambling, and content inappropriate for children",protectionFeature4:"Create whitelist/blacklist to precisely control which pages are allowed to access",protectionFeature5:"Limit access time for each website or software, schedule computer shutdown",protectionFeature6:"Protect mobile devices and computers in the same management system",educationTitle:"EDUCATION AND LEARNING GUIDANCE",educationSubtitle:"KidoLock not only helps manage devices but also encourages children to study and develop good habits:",educationFeature1:"Integrated homework system and educational games help children review knowledge daily",educationFeature2:"Children earn reward points when completing homework or learning tasks",educationFeature3:"Parents can reward extra entertainment time based on points their children achieve",educationFeature4:"Help children develop self-awareness, balance between study and play, comprehensive development",testimonialsTitle1:"PARENTS",testimonialsTitle2:"SAY WHAT ?",testimonial1Title:"TOO GOOD",testimonial1Content:"Now I can limit my child's access to certain websites at specific hours or just turn off the computer completely. I get instant notifications when my child tries to access unrecommended or blocked websites.",testimonial2Title:"PERFECT",testimonial2Content:"I like this app. It allows me to track my child's activities and control when they can access certain websites. I like that they can request access from their laptop and then I can just approve or deny this request from my phone.",testimonial3Title:"EXCEEDS EXPECTATIONS",testimonial3Content:"I can update more than expected what I want to know about my children's digital life. I can know where they are, where they have been and even tell them if they need to charge their iPhones – and I'm using Android without any problems.",pricingSubtitle:"SERVICE PACKAGES",pricingTitle1:"CHOOSE THE PACKAGE",pricingTitle2:"THAT SUITS YOU",otherPackages:"OTHER PACKAGES",viewDetails:"VIEW DETAILS",loadingPackages:"Loading packages...",deviceUser:"1 device | 1 user",freeTrial:"TRIAL PACKAGE",free:"FREE",downloadHeader1:"DOWNLOAD THE APP ON",downloadHeader2Left:"ALL PLATFORMS",downloadHeader2Right:"DEVICES",downloadExe:"DOWNLOAD EXE",preparingDownload:"Preparing",downloading:"Downloading",downloadTitle:"Download KidLock",tutorialTab:"User Guide",downloadTab:"Download",selectVersion:"Select Version",latestVersion:"Latest Version",latestVersionDesc:"Stable version with the latest features",stableVersionDesc:"Stable version that has been thoroughly tested",legacyVersionDesc:"Legacy version, only recommended for older systems",packageContents:"Package Contents",downloadNow:"Download Now",loadingVersions:"Loading versions...",latest:"Latest",forAllDevices:"For all devices",requiresInternet:"Requires internet connection",systemRequirements:"System requirements",windowsTitle:"Windows® desktops and laptops",diskSpace:"Disk space",freeDiskSpace:"free disk space",cpu:"CPU",orHigher:"or higher",or:"or",memory:"Memory",minScreenRes:"Minimum screen resolution",androidTitle:"Android smartphones and tablets¹",os:"Operating system",iosTitle:"iPhone and iPad",languageSupport:"Language support",vietnamese:"Vietnamese",vietnameseDesc:"Ensures ease of understanding and use across all platforms",english:"English",englishDesc